import React, { useState, useEffect } from "react";
import Axios from "axios";

function HomePage() {
    const [data, setData] = useState(null);

    return (
        <div>
            <div>
                {data ? <h1>Welcome Back {data.username}</h1> : <h1>Welcome</h1>}
            </div>
        </div>
    );
}

export default HomePage;
